-- ----------------------------
-- Table structure for pf_admins
-- ----------------------------
DROP TABLE IF EXISTS `pf_admins`;
CREATE TABLE `pf_admins` (
  `admin_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_account` varchar(50) NOT NULL,
  `password` varchar(40) NOT NULL DEFAULT '',
  `nick_name` varchar(50) NOT NULL,
  `true_name` varchar(120) NOT NULL,
  `user_role` tinyint(1) NOT NULL DEFAULT '1' COMMENT '部门 (市场 研发 人事)',
  `role_type` int(4) NOT NULL DEFAULT '3' COMMENT '角色  （总经理，经理，员工）',
  `group_role` tinyint(2) NOT NULL DEFAULT '0' COMMENT '子公司',
  `is_closed` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `area_limits` text NOT NULL,
  `user_touch` text NOT NULL,
  `qq` varchar(30) NOT NULL,
  `mobile` varchar(11) NOT NULL,
  `login_count` int(11) NOT NULL DEFAULT '0',
  `token` varchar(11) NOT NULL DEFAULT '514438556',
  `last_time` datetime NOT NULL,
  PRIMARY KEY (`admin_id`),
  UNIQUE KEY `admin_name` (`user_account`),
  KEY `service` (`user_role`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='管理员表';

-- ----------------------------
-- Records of pf_admins
-- ----------------------------

-- ----------------------------
-- Table structure for pf_advert
-- ----------------------------
DROP TABLE IF EXISTS `pf_advert`;
CREATE TABLE `pf_advert` (
  `advert_id` int(11) NOT NULL AUTO_INCREMENT,
  `advert_master_id` int(11) NOT NULL COMMENT '关联广告主id',
  `shift_id` int(11) NOT NULL COMMENT '转投项目id',
  `advert_name` varchar(50) NOT NULL COMMENT '广告名称',
  `advert_type` int(11) NOT NULL COMMENT '广告类型 播放器 信用卡.。。',
  `advert_size` int(11) NOT NULL COMMENT '广告寸尺(100*100)',
  `platform` varchar(20) NOT NULL DEFAULT 'normal' COMMENT '平台,安卓,IOS,通用',
  `total_amount` int(255) NOT NULL COMMENT '总投放量',
  `intraday_amount` int(255) NOT NULL COMMENT '当天投放量',
  `advert_price` decimal(10,2) NOT NULL COMMENT '广告单价',
  `site_price` decimal(10,2) NOT NULL COMMENT '广告单价',
  `advert_rate` decimal(5,2) NOT NULL COMMENT '广告扣量',
  `charge_point` tinyint(1) NOT NULL COMMENT '表示:计费点（如,展示，跳转，安装等）',
  `charge_kind` tinyint(1) NOT NULL COMMENT '计费方式（uv，ip，pv）',
  `status` int(2) NOT NULL COMMENT '1待审核，2正常，3暂停，4拒绝',
  `is_redis` int(1) NOT NULL COMMENT '0更新1需要更新详细2更新信息完成',
  `sort_order` int(11) NOT NULL DEFAULT '999' COMMENT '排序',
  `is_arrived` int(2) NOT NULL DEFAULT '1' COMMENT '不加2加',
  `is_build` int(2) NOT NULL DEFAULT '1',
  `is_rate` int(255) NOT NULL COMMENT '是否扣量',
  `add_time` datetime NOT NULL,
  PRIMARY KEY (`advert_id`),
  KEY `adtype` (`advert_type`),
  KEY `charge` (`charge_kind`,`charge_point`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=622 DEFAULT CHARSET=utf8 COMMENT='广告表';

-- ----------------------------
-- Records of pf_advert
-- ----------------------------

-- ----------------------------
-- Table structure for pf_advert_direct
-- ----------------------------
DROP TABLE IF EXISTS `pf_advert_direct`;
CREATE TABLE `pf_advert_direct` (
  `direct_id` int(11) NOT NULL AUTO_INCREMENT,
  `advert_id` int(11) NOT NULL COMMENT '广告id',
  `start_time` varchar(50) NOT NULL COMMENT '放开始时间',
  `end_time` varchar(50) NOT NULL COMMENT '结束时间',
  `hours` text NOT NULL COMMENT '投放小时段',
  `area` text NOT NULL COMMENT '投放地区',
  `only_user` text NOT NULL COMMENT '只特许用户',
  PRIMARY KEY (`direct_id`),
  UNIQUE KEY `ad_id` (`advert_id`)
) ENGINE=MyISAM AUTO_INCREMENT=655 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of pf_advert_direct
-- ----------------------------

-- ----------------------------
-- Table structure for pf_advert_master
-- ----------------------------
DROP TABLE IF EXISTS `pf_advert_master`;
CREATE TABLE `pf_advert_master` (
  `advert_master_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(10) NOT NULL COMMENT '用户名',
  `pass_word` varchar(50) NOT NULL COMMENT '密码',
  `company_name` varchar(20) NOT NULL COMMENT '网站名称',
  `contact_name` varchar(8) NOT NULL COMMENT '联系人',
  `contact_tel` bigint(8) NOT NULL COMMENT '联系电话',
  `contact_qq` varchar(20) NOT NULL,
  `contact_email` varchar(40) NOT NULL,
  `total_recharge_money` decimal(10,0) NOT NULL COMMENT '总的充值金额',
  `status` int(10) NOT NULL DEFAULT '1' COMMENT '1待审核 2正常 3暂停 4拒绝',
  `admin_id` int(11) NOT NULL,
  PRIMARY KEY (`advert_master_id`),
  UNIQUE KEY `username` (`user_name`)
) ENGINE=MyISAM AUTO_INCREMENT=209 DEFAULT CHARSET=utf8 COMMENT='广告主基本信息表';

-- ----------------------------
-- Records of pf_advert_master
-- ----------------------------

-- ----------------------------
-- Table structure for pf_advert_material
-- ----------------------------
DROP TABLE IF EXISTS `pf_advert_material`;
CREATE TABLE `pf_advert_material` (
  `material_id` int(11) NOT NULL AUTO_INCREMENT,
  `advert_id` int(11) NOT NULL COMMENT '广告id',
  `image_url` text COMMENT '素材地址',
  `down_url` text COMMENT '下载地址',
  `direct_url` text NOT NULL COMMENT '转跳地址',
  PRIMARY KEY (`material_id`),
  KEY `ad_id` (`advert_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2642 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of pf_advert_material
-- ----------------------------

-- ----------------------------
-- Table structure for pf_as_adplaces
-- ----------------------------
DROP TABLE IF EXISTS `pf_as_adplaces`;
CREATE TABLE `pf_as_adplaces` (
  `adplace_id` int(11) NOT NULL AUTO_INCREMENT,
  `site_id` int(11) NOT NULL COMMENT '站点id',
  `name` varchar(15) NOT NULL COMMENT '广告位名称',
  `ad_size` int(11) NOT NULL COMMENT '广告尺寸100*100',
  `ad_type` enum('jump','banner','inbanner','spot') NOT NULL COMMENT '广告形式',
  `allow_advert_type` varchar(1000) NOT NULL COMMENT '允许的广告类型',
  `refused_advert` varchar(1000) NOT NULL COMMENT '单独拒绝的广告',
  `is_trustree` int(3) NOT NULL DEFAULT '1' COMMENT '1不拖管2托管',
  `is_build` int(11) NOT NULL DEFAULT '1' COMMENT '没有生成',
  `update_time` datetime NOT NULL COMMENT '操作时间',
  PRIMARY KEY (`adplace_id`)
) ENGINE=MyISAM AUTO_INCREMENT=1467 DEFAULT CHARSET=utf8 COMMENT='广告位表';

-- ----------------------------
-- Records of pf_as_adplaces
-- ----------------------------

-- ----------------------------
-- Table structure for pf_as_blacklist
-- ----------------------------
DROP TABLE IF EXISTS `pf_as_blacklist`;
CREATE TABLE `pf_as_blacklist` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `source_type` varchar(50) NOT NULL COMMENT 'siteToAd站点拉黑广告  adToSite广告拉黑站点',
  `site_id` int(11) NOT NULL COMMENT '站点id',
  `ad_id` int(11) NOT NULL COMMENT '广告ID',
  `update_time` datetime NOT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2029 DEFAULT CHARSET=utf8 COMMENT='站长广告投放拉黑表';

