-- ----------------------------
-- Table structure for pf_data_count_date
-- ----------------------------
DROP TABLE IF EXISTS `pf_data_count_date`;
CREATE TABLE `pf_data_count_date` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `site_id` int(11) NOT NULL COMMENT '站点id',
  `advert_id` int(11) NOT NULL COMMENT '广告ID',
  `data_date` date NOT NULL COMMENT '时间',
  `point` int(1) NOT NULL COMMENT '计费点',
  `kind` int(1) NOT NULL COMMENT '计费点',
  `ad_count` int(11) NOT NULL COMMENT '广告主数据',
  `site_count` int(11) NOT NULL COMMENT '网站主数据',
  `advert_money` decimal(11,2) NOT NULL COMMENT '广告主的钱',
  `site_money` decimal(11,2) NOT NULL COMMENT '网站主的钱',
  `status` int(1) NOT NULL COMMENT '0未结算 1结算 2不结算',
  `update_time` datetime NOT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `group` (`site_id`,`advert_id`,`data_date`,`point`,`kind`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=248965 DEFAULT CHARSET=utf8 COMMENT='数据归档天表';

-- ----------------------------
-- Records of pf_data_count_date
-- ----------------------------

-- ----------------------------
-- Table structure for pf_data_count_log
-- ----------------------------
DROP TABLE IF EXISTS `pf_data_count_log`;
CREATE TABLE `pf_data_count_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `site_id` int(11) NOT NULL COMMENT '站点id',
  `advert_id` int(11) NOT NULL COMMENT '广告ID',
  `data_hour` int(2) NOT NULL COMMENT '小时数据',
  `data_date` date NOT NULL COMMENT '时间',
  `point` int(1) NOT NULL COMMENT '计费点,分类--弹窗，或者什么分类',
  `kind` int(10) NOT NULL COMMENT '计费点 pv ck',
  `ad_count` int(11) NOT NULL COMMENT '广告主数据',
  `site_count` int(11) NOT NULL COMMENT '网站主数据',
  `update_time` datetime NOT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `group` (`site_id`,`data_hour`,`advert_id`,`data_date`,`point`,`kind`) USING BTREE,
  KEY `bannerid` (`advert_id`) USING HASH,
  KEY `siteid` (`site_id`) USING HASH,
  KEY `data` (`data_date`) USING BTREE,
  KEY `log` (`data_date`,`point`,`kind`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=27566449 DEFAULT CHARSET=utf8 COMMENT='数据日志表';

-- ----------------------------
-- Records of pf_data_count_log
-- ----------------------------

-- ----------------------------
-- Table structure for pf_site
-- ----------------------------
DROP TABLE IF EXISTS `pf_site`;
CREATE TABLE `pf_site` (
  `site_id` int(11) NOT NULL AUTO_INCREMENT,
  `site_master_id` int(11) NOT NULL COMMENT '站点id',
  `site_name` varchar(20) NOT NULL COMMENT '网站名',
  `site_url` varchar(100) NOT NULL COMMENT '网站地址',
  `site_rate` decimal(20,2) NOT NULL DEFAULT '1.00' COMMENT '税率',
  `is_redis` int(1) NOT NULL DEFAULT '0' COMMENT '0代表需要更新1代表已经更新',
  `site_type` int(10) NOT NULL DEFAULT '0' COMMENT '网站类型',
  `is_build` int(1) NOT NULL DEFAULT '1' COMMENT '1未生成2已生成',
  `position` int(1) NOT NULL DEFAULT '1' COMMENT '1底部2顶部',
  `is_random_close` int(1) NOT NULL DEFAULT '1' COMMENT '是否开启点击关闭 随机跳转 1否 2是',
  `is_transpare` int(1) NOT NULL DEFAULT '1' COMMENT '是否允许透明区域点击  2允许',
  `transpare_random` int(10) NOT NULL DEFAULT '30',
  `open_style` int(1) NOT NULL DEFAULT '0' COMMENT '是否新窗口打开  0 self   1 blank  2 top',
  `switch_num` int(3) NOT NULL DEFAULT '1',
  `switch_time` int(3) NOT NULL DEFAULT '10',
  `is_shake` int(1) NOT NULL DEFAULT '1',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '1待审核，2正常，3暂停，4拒绝',
  PRIMARY KEY (`site_id`)
) ENGINE=MyISAM AUTO_INCREMENT=1834 DEFAULT CHARSET=utf8 COMMENT='站点网址表';

-- ----------------------------
-- Records of pf_site
-- ----------------------------

-- ----------------------------
-- Table structure for pf_site_master
-- ----------------------------
DROP TABLE IF EXISTS `pf_site_master`;
CREATE TABLE `pf_site_master` (
  `site_master_id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(20) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(40) NOT NULL DEFAULT '' COMMENT '密码',
  `name` varchar(11) NOT NULL DEFAULT '' COMMENT '姓名',
  `qq` varchar(30) NOT NULL,
  `email` varchar(30) NOT NULL DEFAULT '' COMMENT '邮箱',
  `tel` varchar(25) NOT NULL DEFAULT '0' COMMENT 'telphone',
  `bank_type` int(11) NOT NULL COMMENT '1招商2工商3建行',
  `bank_number` varchar(220) NOT NULL COMMENT '收款账号',
  `bank_area` varchar(50) NOT NULL COMMENT '开户行地址',
  `settle_type` int(1) NOT NULL DEFAULT '7' COMMENT '结算天数 默认一周',
  `admin_id` int(11) NOT NULL COMMENT '所属媒介',
  `site_name` varchar(100) NOT NULL COMMENT '网站名称',
  `site_url` varchar(100) NOT NULL COMMENT '域名',
  `site_type` varchar(100) NOT NULL COMMENT '网站类型',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1待审核，2正常，3暂停，4拒绝',
  PRIMARY KEY (`site_master_id`),
  UNIQUE KEY `admin_name` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=1017 DEFAULT CHARSET=utf8 COMMENT='站长基本信息表';

-- ----------------------------
-- Records of pf_site_master
-- ----------------------------
